import React from "react";
import "./App.css";
import mondaySdk from "monday-sdk-js";
import "monday-ui-react-core/dist/main.css"
//Explore more Monday React Components here: https://style.monday.com/
import IconButton from "monday-ui-react-core/dist/Button.js"
import Bolt from "monday-ui-react-core/dist/icons/Bolt.js"

const monday = mondaySdk();

class App extends React.Component {
  constructor(props) {
    super(props);

    // Default state
    this.state = {
      settings: {},
      name: "",
    };
  }

  componentDidMount() {
    // TODO: set up event listeners
  }

  render() {
    return <div className="App">

      <div style={{
        display: "flex",
        justifyContent: "space-evenly",
        alignItems: "center",
        width: "100%"
      }}>
        <IconButton icon={Bolt} kind={IconButton.kinds.PRIMARY} ariaLabel="My primary IconButton" />
        <IconButton icon={"bolt.svg"} kind={IconButton.kinds.SECONDARY} ariaLabel="My secondary IconButton" />
        <IconButton icon={"bolt.svg"} kind={IconButton.kinds.TERTIARY} ariaLabel="My tertiary IconButton" />
      </div>
    </div>;
  }
}

export default App;
